import styled from "styled-components"

const Container = styled.div`
    width: 100%;
    height: 100%;
`
const Header = styled.div`
    width: 100%;
    height: 100vh;
    background-color: yellow;
`
function Home(){
    return(
        <>
            <Container>
                <Header></Header>
            </Container>
        </>
    )
}

export default Home
